import React, { useState } from 'react';
import './App.css';

function App() {
  const [tagId, setTagId] = useState('');
  const [dogData, setDogData] = useState(null);
  const [location, setLocation] = useState('');
  const [hospitalData, setHospitalData] = useState(null);
  const [sightingLocation, setSightingLocation] = useState('');

  // WhatsApp-style location sharing
  const shareLocation = () => {
    if (navigator.geolocation) {
      navigator.geolocation.getCurrentPosition((position) => {
        const url = `https://www.google.com/maps?q=${position.coords.latitude},${position.coords.longitude}`;
        setSightingLocation(url); 
      }, () => alert("Location access denied. Please enter manually."));
    }
  };

  const handleDogSearch = () => {
    const mockDogs = [{ DogID: "RED108", TagNumber: "108", Status: "VACCINATED", Date: "01-02-2026" }];
    setDogData(mockDogs.find(d => d.DogID === tagId.toUpperCase()));
  };

  const handleHospitalSearch = () => {
    setHospitalData({ name: "City Medical Center", distance: "0.8 km", phone: "+91 484 2345678" });
  };

  return (
    <div className="App">
      <header className="emergency-header">
        <h1>RabiesAware Dashboard</h1>
        <div className="emergency-actions">
          <button className="btn-emergency">üìû CALL 112</button>
          <button className="btn-firstaid">ü©π FIRST AID</button>
        </div>
      </header>

      {/* This container manages the horizontal alignment */}
      <main className="main-content">

        {/* LEFT COLUMN: All Search Tools */}
        <div className="search-side">
          <div className="card">
            <h2>üîç Verify Vaccination Tag</h2>
            <div className="input-group">
              <input type="text" placeholder="Enter Tag ID..." value={tagId} onChange={(e) => setTagId(e.target.value)} />
              <button onClick={handleDogSearch}>VERIFY</button>
            </div>
            {dogData && (
              <div className="status-box">
                <p><strong>Status:</strong> {dogData.Status}</p>
                <p>Tag No: {dogData.TagNumber} | Expiry: {dogData.Date}</p>
              </div>
            )}
          </div>

          <div className="card">
            <h2>üè• Nearby Medical Help</h2>
            <div className="input-group">
              <input type="text" placeholder="Enter City..." value={location} onChange={(e) => setLocation(e.target.value)} />
              <button onClick={handleHospitalSearch}>SEARCH</button>
            </div>
            {hospitalData && (
              <div className="status-box">
                <h3>üìç {hospitalData.name}</h3>
                <p>Distance: {hospitalData.distance}</p>
                <button className="btn-call">CALL HOSPITAL</button>
              </div>
            )}
          </div>
        </div>

        {/* RIGHT COLUMN: The Reporting Form */}
        <aside className="report-side">
          <div className="report-card">
            <h2>üì¢ Report Untagged Dog</h2>
            <p>Help ABC Center locate unvaccinated dogs.</p>

            <button className="btn-whatsapp" onClick={shareLocation}>
              üìç Share Current Location
            </button>

            <div className="divider">OR ENTER MANUALLY</div>

            <input 
              type="text" 
              placeholder="Address or Landmarks..." 
              value={sightingLocation}
              onChange={(e) => setSightingLocation(e.target.value)}
            />
            <textarea placeholder="Dog description..." rows="3" />
            <button className="btn-submit">SUBMIT TO ABC CENTER</button>
          </div>
        </aside>

      </main>
    </div>
  );
}

export default App;
